INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('0ae8d7c4-6785-4fa9-9a6b-b60f657a0eab', 'Bicep Curl', 'Dumbbell Bicep Curl', 'The Bicep Curl primarily targets the bicep muscles, with secondary engagement of the forearms and shoulders. It''s great for building arm strength, enhancing muscle tone, and improving muscle endurance. Additionally, it helps in developing better elbow joint flexibility and can be a foundational exercise for arm training routines.', 'Easy', false, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/bicep-curl.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/bicep-curl-thumbnail.jpg', 'https://vimeo.com/121851277', '90b22d7d-c300-43e5-bae4-7df172dc168e');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('7a0f6e96-57b7-40b6-b27f-4e3f088c47ca', 'Good Mornings', 'Barbell Good Mornings', 'The Barbell Good Morning primarily targets the hamstrings, glutes, and lower back muscles. It''s excellent for strengthening the posterior chain, improving hip hinge mechanics, and enhancing core stability. Additionally, it aids in better posture and can be beneficial for increasing hamstring flexibility and lower back strength.', 'Advanced', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/good-mornings.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/good-mornings-thumbnail.jpg', 'https://youtu.be/dlKXx3uUsY8', '806a76dc-36c7-40ec-9da3-9da81e3350e9');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('a33ebc0f-26fb-4031-ab40-268e62e27cb9', 'Dips', 'Tricep Dips', 'Dips primarily target the triceps, chest, and shoulders. They''re excellent for building upper body strength, enhancing muscle definition, and improving shoulder mobility. Additionally, dips aid in developing better stability and coordination as they require balancing the body while moving through the exercise.', 'Intermediate', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/tricep-dip.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/tricep-dip-thumbnail.jpg', 'https://youtu.be/JH5srFgz8Nk', '61800086-6f86-4841-906d-c2dcf0dc0e97');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('4fc3c5da-a928-4b88-a670-80afe057bad5', 'Step-up', 'Dumbbell Step-up', 'The Step-Up primarily targets the quadriceps, hamstrings, and glutes. It''s excellent for improving lower body strength, enhancing balance, and promoting single-leg stability. Additionally, it can help in correcting muscle imbalances and is a functional exercise that mimics everyday movements.', 'Intermediate', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/step-up.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/step-up-thumbnail.jpg', 'https://vimeo.com/111125511', '38d0ce32-05b7-4b49-8b63-e6c25221d806');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('69949b6e-5f5b-4c55-9517-38720807b747', 'Hammer Curl', 'Dumbbell Hammer Curl', 'The Hammer Curl targets the biceps and brachialis muscles, with secondary engagement of the forearms. It''s effective for building arm strength, improving muscle definition, and enhancing grip strength. The neutral grip used in this exercise provides a variation that may be easier on the wrists and elbows compared to traditional curls.', 'Easy', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/hammer-curl.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/hammer-curl-thumbnail.jpg', 'https://vimeo.com/121851466', '90b22d7d-c300-43e5-bae4-7df172dc168e');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('16e47117-87f2-4305-9de8-f31bc83765d7', 'Pullover', 'Dumbbell Chest Pullover', 'The Pullover targets the latissimus dorsi, chest, and triceps. It''s great for expanding the rib cage, improving shoulder mobility, and building strength and muscle mass in the upper body. Additionally, it''s a unique exercise that works on both the chest and back muscles, promoting a balanced upper body.', 'Intermediate', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/pull-over.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/pull-over-thumbnail.jpg', 'https://youtu.be/5YStMv6m2g8', '99aab13e-668c-4019-96e3-fa76aa9d463a');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('323efdd9-2c39-4dfa-9de1-24a836b6b82b', 'Plank', 'Bodyweight Plank', 'The Plank exercise engages multiple muscle groups including the core, glutes, shoulders, and back. It''s stellar for improving core strength, enhancing stability, and promoting a strong and stable trunk. Additionally, it aids in developing better posture, reducing back pain, and is a foundational exercise for training the core and improving overall body strength.', 'Intermediate', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/plank.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/plank-thumbnail.jpg', 'https://vimeo.com/111471004', '27a50c57-ad5b-4528-b884-0180cfdf99c2');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('de14fb5e-ba32-4f08-b69a-5a0722a81ba1', 'Romanian Deadlift', 'Barbell Romanian Deadlift', 'The Romanian Deadlift primarily targets the hamstrings, glutes, and lower back. It''s outstanding for developing posterior chain strength, improving hip hinge mechanics, and enhancing hamstring flexibility. Additionally, it aids in better posture and can be a significant exercise for improving athletic performance and overall lower body strength.', 'Advanced', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/romanian-deadlift.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/romanian-deadlift-thumbnail.jpg', 'https://vimeo.com/111043979', '806a76dc-36c7-40ec-9da3-9da81e3350e9');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('4c5c6ca4-e190-4bd3-b05a-b445c324a680', 'Shoulder Press', 'Seated Dumbbell Shoulder Press', 'The Shoulder Press targets the deltoids, triceps, and to a lesser extent, the upper chest. It''s excellent for building shoulder strength, enhancing upper body muscle mass, and improving overhead lifting capabilities. This exercise is crucial for individuals looking to develop well-rounded shoulder muscles and improve functional upper body strength.', 'Easy', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/shoulder-press.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/shoulder-press-thumbnail.jpg', 'https://vimeo.com/111522887', 'da8c8065-3b42-472f-934a-1a55e772a749');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('552c548a-9fb7-41bc-9c9a-aeb3057a1cf9', 'Tricep Extension', 'Overhead Tricep Extension', 'The Tricep Extension specifically targets the tricep muscles. It''s effective for building arm strength, improving muscle definition in the triceps, and enhancing elbow joint extension. This exercise can be performed using dumbbells, barbells, or cable machines, making it a versatile choice for arm training.', 'Easy', false, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/overhead-tricep-extension.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/overhead-tricep-extension-thumbnail.jpg', 'https://youtu.be/LlCFtWCQc5s', '61800086-6f86-4841-906d-c2dcf0dc0e97');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('631cec69-e127-4049-839c-3b24b5924a55', 'Lunges', 'Walking Dumbbell Lunge', 'The Walking Dumbbell Lunge targets the quadriceps, hamstrings, and glutes, with secondary engagement of the core and balance muscles. It''s excellent for building lower body strength, improving hip mobility, and enhancing overall body coordination. Additionally, it''s a functional exercise that can aid in better performance in daily activities and sports.', 'Easy', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/lunge.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/lunge-thumbnail.jpg', 'https://vimeo.com/112074203', '38d0ce32-05b7-4b49-8b63-e6c25221d806');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('322b17d4-9f5c-404e-82c4-774e06620a72', 'Single-Leg Romanian', 'Single-Leg Romanian Deadlift', 'The Romanian Deadlift primarily targets the hamstrings, glutes, and lower back. It''s outstanding for developing posterior chain strength, improving hip hinge mechanics, and enhancing hamstring flexibility. Additionally, it aids in better posture and can be a significant exercise for improving athletic performance and overall lower body strength.', 'Advanced', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/single-leg-deadlift.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/single-leg-deadlift-thumbnail.jpg', 'https://vimeo.com/111525384', '806a76dc-36c7-40ec-9da3-9da81e3350e9');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('c89ff951-a57d-471f-8149-b791f4679dc5', 'Reverse Fly', 'Dumbbell Reverse Fly', 'The Reverse Fly targets the back, posterior deltoids (rear shoulders), rhomboids, and traps in the upper back. It''s great for improving shoulder stability, enhancing posture, and building a balanced upper body by strengthening the often neglected posterior shoulder and upper back muscles. Additionally, it aids in counteracting the hunched posture developed from daily activities like sitting at a desk.', 'Intermediate', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/reverse-fly.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/reverse-fly-thumbnail.jpg', 'https://youtu.be/Fgz_FdzDukE', '9db6507a-89a3-4515-8e4e-316183954c1b');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('4042036c-f5be-43a0-8bb5-281baeef3576', 'Kick-back', 'Glute Kick Back', 'The Glute Kick Back targets the glutes and to a lesser extent, the hamstrings. It''s great for toning and strengthening the buttocks, enhancing hip mobility, and improving lower body coordination. Additionally, it can aid in alleviating lower back pain by strengthening the glutes which support the lower back.', 'Easy', false, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/glute-kickback.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/glute-kickback-thumbnail.jpg', 'https://youtu.be/aX0U98L4Ywk', 'b1c40c7a-c96f-49b0-bab4-ad196bc20c70');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('30100434-5a72-4b12-9836-7f2f0db67833', 'Squat', 'Barbell Back Squat', 'The Barbell Back Squat targets the quadriceps, hamstrings, glutes, and calves, with core and lower back engagement. It''s excellent for building lower body strength, enhancing mobility, improving posture, and promoting muscle growth. Plus, as a compound movement, it aids in better calorie burn and fat loss.', 'Advanced', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/barbell-back-squat.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/barbell-back-squat-thumbnail.jpg', 'https://vimeo.com/121830733', '38d0ce32-05b7-4b49-8b63-e6c25221d806');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('fcae1fd6-d15c-4c38-b559-e1253775a05b', 'Deadlift', 'Barbell Deadlift', 'The Barbell Deadlift mainly targets the hamstrings, glutes, lower and upper back, and grip muscles. It''s a stellar exercise for developing overall strength, enhancing posterior chain muscle development, improving posture, and boosting muscle growth. Additionally, being a compound movement, it supports greater calorie expenditure and fat loss.', 'Advanced', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/deadlift.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/deadlift-thumbnail.jpg', 'https://vimeo.com/121834063', 'b1c40c7a-c96f-49b0-bab4-ad196bc20c70');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('e0b662a7-3801-480f-950e-17fd96badd13', 'Bench Press', 'Dumbbell Bench Press', 'The Bench Press primarily targets the pectoral muscles (chest), deltoids (shoulders), and triceps. It''s a key exercise for building upper body strength, enhancing muscle mass, and improving pushing ability. Additionally, it contributes to better bone health, and being a compound movement, it helps in burning more calories during and after the workout.', 'Intermediate', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/bench-press.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/bench-press-thumbnail.jpg', 'https://vimeo.com/111113503', '99aab13e-668c-4019-96e3-fa76aa9d463a');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('22c41f6a-69a0-432e-9cb6-ec8ec20d1049', 'Chin-Up', 'Bicep Chin-Up', 'The Chin-Up primarily targets the latissimus dorsi (back muscles), biceps, and forearms. It''s an effective exercise for building upper body strength, enhancing back muscle definition, and improving grip strength. Additionally, chin-ups promote shoulder health and mobility.', 'Advanced', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/chin-up.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/chin-up-thumbnail.jpg', 'https://vimeo.com/111054636', '90b22d7d-c300-43e5-bae4-7df172dc168e');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('51e2b73d-b2db-40a0-98cf-bd2fe0f5c038', 'Glute bridge', 'Bridge', 'The Glute Bridge primarily engages the glutes, hamstrings, and lower back muscles. It''s beneficial for improving hip mobility, enhancing glute strength, and promoting better posture. Additionally, it''s a low-impact exercise that can be modified for different fitness levels and can be beneficial for individuals with lower back issues.', 'Intermediate', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/glute-bridge.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/glute-bridge-thumbnail.jpg', 'https://vimeo.com/111043114', 'b1c40c7a-c96f-49b0-bab4-ad196bc20c70');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('ed22b807-8824-44f4-986b-138366134322', 'Hanging Raise', 'Abs Hanging Leg Raise', 'The Abs Hanging Raise primarily targets the rectus abdominis (abs) and hip flexors, with secondary engagement of the forearms and upper back muscles. It''s a challenging exercise that helps in developing core strength, improving abdominal muscle definition, and enhancing upper body endurance. Additionally, it promotes better stability and control which can be beneficial in performing other exercises and daily activities.', 'Advanced', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/hanging-leg-raise.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/hanging-leg-raise-thumbnail.jpg', 'https://youtu.be/Voa4JvQ76A8', '27a50c57-ad5b-4528-b884-0180cfdf99c2');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('6fd8a488-76d5-49c3-b6d5-6f072d07b287', 'Lateral Raise', 'Dumbbell Side Lateral Rise', 'The Lateral Raise primarily targets the deltoids, particularly the lateral or "middle" part, aiding in creating a broader shoulder appearance. It''s excellent for improving shoulder strength, enhancing muscle tone, and promoting balanced muscle development to counteract the effects of too much pressing and front deltoid work.', 'Easy', false, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/shoulder-lateral-raise.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/shoulder-lateral-raise-thumbnail.jpg', 'https://youtu.be/Cxrmdrq1s3E', 'da8c8065-3b42-472f-934a-1a55e772a749');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('99e68eff-4116-4894-8a51-70e49404fff7', 'Pull up', 'Pull Ups', 'The Pull Up primarily targets the latissimus dorsi, biceps, and forearms. It''s an effective exercise for building upper body strength, enhancing back muscle definition, and improving grip strength. Additionally, pull-ups promote shoulder health and can significantly contribute to better posture and functional strength.', 'Advanced', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/pull-up.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/pull-up-thumbnail.jpg', 'https://vimeo.com/122357901', '9db6507a-89a3-4515-8e4e-316183954c1b');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('e52463a7-3efa-4938-a57f-b7796430388a', 'Standing Calf Raise', 'Standing Dumbbells Calf Raise', 'The Standing Calf Raise primarily targets the gastrocnemius muscle in the calves. It''s beneficial for building calf strength, improving ankle stability, and enhancing lower leg muscle tone. This exercise can also aid in improving balance and performance in sports and activities that require strong calf muscles.', 'Easy', false, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/standing-calf-raise.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/standing-calf-raise-thumbnail.jpg', 'https://youtu.be/RBslMmWqzzE', '92b3d594-9a1a-4e43-ad7f-2e9a8f08366b');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('a0015c74-06ce-4905-ab9d-5a7930145cce', 'Rest', 'Rest Day', 'Rest is integral for muscle recovery, as it allows the repair of micro-tears in muscle tissues incurred during exercise, promoting muscle growth and increased strength. Additionally, adequate rest helps prevent overuse injuries, ensuring that the body is well-recovered and prepared for subsequent workouts, which in turn reduces the risk of fatigue-related accidents.', 'Easy', false, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/rest.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/rest-thumbnail.jpg', 'https://youtu.be/oMYyDYUrDi4', '84bc14b4-f64c-4b38-bf60-5ae5b7c19dc4');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('059383f4-6e2b-4d9f-90f2-bb17781fa2a4', 'Push Up', 'Bodyweight Push Up', 'The Push Up primarily targets the chest, triceps, and shoulders, with secondary engagement of the core and lower body muscles. It''s excellent for building upper body strength, enhancing muscle endurance, and promoting better bone health. Additionally, as a bodyweight exercise, push-ups are versatile and can be modified to meet different fitness levels, making them a fundamental component of many fitness routines.', 'Easy', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/push-up.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/push-up-thumbnail.jpg', 'https://vimeo.com/122357903', '99aab13e-668c-4019-96e3-fa76aa9d463a');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('c28a23d6-18ef-4bec-99b9-3020b2b430e5', 'Rear Delt Raise', 'Dumbbell Rear Delt Raise', 'The Rear Delt Raise specifically targets the posterior deltoids (rear shoulders) with secondary engagement of the upper back muscles. It''s excellent for improving shoulder balance, enhancing posture, and building strength in the often neglected rear shoulder area. This exercise is pivotal for individuals looking to achieve a well-balanced shoulder development and can help in preventing shoulder injuries.', 'Intermediate', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/bent-over-lateral-raise.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/bent-over-lateral-raise-thumbnail.jpg', 'https://youtu.be/Fgz_FdzDukE', 'da8c8065-3b42-472f-934a-1a55e772a749');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('a0eef689-04c5-4faa-a9ae-74305164e830', 'Sit Up', 'Abs Sit Up', 'The Sit Up primarily targets the rectus abdominis (abdominal muscles) and engages the obliques and hip flexors to a lesser extent. It''s effective for building core strength, enhancing abdominal muscle tone, and improving trunk stability. Additionally, it can contribute to better posture by promoting a strong and stable core. Sit Ups can be a part of a comprehensive core training routine to improve overall fitness and function.', 'Intermediate', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/crunch.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/crunch-thumbnail.jpg', 'https://youtu.be/MQDopvLZOS8', '27a50c57-ad5b-4528-b884-0180cfdf99c2');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('dd3734b1-f939-4af0-8a20-8104f60345ff', 'Sitting Calf Raise', 'Dumbbells Calf Raise', 'The Sitting Calf Raise specifically targets the soleus muscle in the calves. It''s excellent for building calf strength, improving ankle stability, and enhancing the muscle tone of the lower leg. Additionally, it can aid in preventing calf muscle strains and improving performance in activities that require strong and stable ankles and calves. This exercise is beneficial for individuals looking to develop well-defined calf muscles and improve lower body function.', 'Intermediate', false, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/seatead-calf-raise.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/seatead-calf-raise-thumbnail.jpg', 'https://youtu.be/Yh5TXz99xwY', '92b3d594-9a1a-4e43-ad7f-2e9a8f08366b');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('d937722a-fb94-4c9b-9def-aebc7d11edb3', 'Tip-Toe Farmer''s Walk', 'Dumbbells Farmer''s Walk', 'The Tip Toe Farmer''s Walk engages the calves, core, and shoulders, while also challenging balance and coordination. It''s great for building lower leg strength, enhancing core stability, and improving overall body endurance. This exercise mimics everyday movements making it functional and beneficial for individuals of varying fitness levels.', 'Intermediate', false, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/farmers-walk-on-toes.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/farmers-walk-on-toes-thumbnail.jpg', 'https://youtu.be/RL7GGbLEOQk', '92b3d594-9a1a-4e43-ad7f-2e9a8f08366b');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('d799c1e1-55ff-4f0f-9777-b68338796324', 'Tricep Kickback', 'Bent Over Tricep Kickback', 'The Tricep Kickback primarily targets the triceps. It''s beneficial for toning and strengthening the back of the arms, improving muscle endurance, and aiding in better elbow extension. It''s a simple yet effective exercise for individuals looking to target tricep development specifically.', 'Easy', false, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/tricep-kickback.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/tricep-kickback-thumbnail.jpg', 'https://youtu.be/BL9CzOQZDrs', '61800086-6f86-4841-906d-c2dcf0dc0e97');
INSERT INTO public.fitness_exercise (id, name, alternative_name, description, difficulty, compound_movement, link_to_image, link_to_thumbnail, link_to_video, main_muscle_id) VALUES ('55806bfc-4993-4d55-a81c-0e1dc7016b98', 'Single-Arm Rows', 'Single-Arm Dumbbell Rows', 'Rows primarily target the muscles of the upper back including the latissimus dorsi, rhomboids, and traps, with secondary engagement of the biceps. They''re beneficial for building a stronger back, improving posture, and enhancing scapular movement and stability. Rows are fundamental for counteracting the effects of prolonged sitting and developing a balanced upper body.', 'Intermediate', true, 'https://ensaludoptima-images.s3.amazonaws.com/exercises/main/dumbbell-row.jpg', 'https://ensaludoptima-images.s3.amazonaws.com/exercises/thumbnail/dumbbell-row-thumbnail.jpg', 'https://vimeo.com/123132865', '9db6507a-89a3-4515-8e4e-316183954c1b');
